import React, { useState } from "react";

import { TeamStyle } from "./TeamStyle";
import FontP from "../../styles/fontsStyles/fontP";
import Fonth1 from "../../styles/fontsStyles/Fonth1"
import Fonth2 from "../../styles/fontsStyles/Fonth2"

import home from "../../content/home.json"
import team from "../../content/team.json"


const displayImg = () => {
    return (
        home.map((member, i) => {
            const { img } = member;
            <div className="colum1" >
                <img src={img} />
            </div>

        })
    )
}
const displayTitle = () => {
    return (
        home.map((member, i) => {
            const { title } = member;
            <div className="title">
                <Fonth2> {title}</Fonth2>
            </div>
        })
    )
}

const displayTeam = () => {
    return (
        team.map((member, i) => {
            const { img, title, name, cargo } = member;
            return (
                <div className="global" key={i} >
                    <div className="colum1" >
                        <img src={img} />
                    </div>
                    <div className="title">
                        <Fonth2> {title}</Fonth2>
                    </div>
                    <div className="colum1">
                        <div className="text">
                            <Fonth1> {name}</Fonth1>
                            <a href="linkedin"><FontP> {cargo}</FontP></a>
                        </div>
                    </div>
                </div>
            )
        })
    )
}


const Team = props => {
    return (
        <TeamStyle >
            <div className="global" key={i} >
                <div className="colum1" >
                    {displayImg()}
                </div>
                <div className="title">
                        {displayTitle()}
                </div>
                <div className="colum1">
                    <div className="text">
                        <Fonth1> {name}</Fonth1>
                        <a href="linkedin"><FontP> {cargo}</FontP></a>
                    </div>
                </div>
            </div>


        </TeamStyle>
    );
};

export default Team;
